  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'Inicialização',
	slug: '/'
};
export const metadata = {
  "unversionedId": "inicialization",
  "id": "inicialization",
  "isDocsHomePage": false,
  "title": "Inicialização",
  "description": "Depois de adicionar a tag de script em seu site, os métodos de inicialização do SDK estarão disponíveis por meio do objeto global R2U.",
  "source": "@site/docs/inicialization.md",
  "slug": "/",
  "permalink": "/docs/",
  "version": "current",
  "sidebar": "docs",
  "previous": {
    "title": "Integração",
    "permalink": "/docs/integrations"
  },
  "next": {
    "title": "Visualizador 3D",
    "permalink": "/docs/3D-viewer"
  }
};
  /* @jsxRuntime classic */
/* @jsx mdx */

export const toc = [{
  value: 'R2U.init',
  id: 'r2uinit',
  children: []
}, {
  value: 'R2U.sku.isActive',
  id: 'r2uskuisactive',
  children: []
}, {
  value: 'R2U.analytics.send',
  id: 'r2uanalyticssend',
  children: [{
    value: 'Parâmetros',
    id: 'parâmetros',
    children: []
  }]
}];

const layoutProps = {
  toc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Depois de adicionar a tag de script em seu site, os métodos de inicialização do SDK estarão disponíveis por meio do objeto global R2U.`}</p>
    <h2 {...{
      "id": "r2uinit"
    }}>{`R2U.init`}</h2>
    <p>{`O método Init inicializa o SDK e se conecta ao servidor R2U e verifica se o customerId existe na nossa base de dados.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{` // cliente de teste - lembre de substituir pelo seu \`customerId\`
R2U.init({
  customerId: '5e8e7580404328000882f4ae',
  analyticsParams: {
    dataLayerIntegration: true, // Ativar integração com "dataLayer" do Google Tag Manager (dafault: true)
    sessionDurationMinutes: 30 // Duração máxima de inatividade em minutos dentro de uma sessão. Usar mesmo valor que no Google Analytics (default: 30)
  }
})
  .then(() => console.log('Cliente ativo'))
  .catch((err) => console.error('Cliente inativo'))
`}</code></pre>
    <h2 {...{
      "id": "r2uskuisactive"
    }}>{`R2U.sku.isActive`}</h2>
    <p>{`O método sku.isActive indica se um produto está disponível na plataforma de RA.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`  // cliente de teste -- lembre de substituir pelo seu \`sku\`
  R2U.sku.isActive('RE000001').then((isActive) => console.log(\`SKU active? \${isActive ? '✓' : '✗'}\`))
`}</code></pre>
    <h2 {...{
      "id": "r2uanalyticssend"
    }}>{`R2U.analytics.send`}</h2>
    <p>{`O método analytics envia métricas e dimensões, para identificar o potencial da inserção das nossas soluções.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`const addToCartButton = document.getElementById('add-to-cart')
addToCartButton.addEventListener('click', () =>
  R2U.analytics.send({
    event: 'add_to_cart',
    data: { price: 30 }
  })
)
`}</code></pre>
    <h3 {...{
      "id": "parâmetros"
    }}>{`Parâmetros`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-typescript"
      }}>{`interface R2U {
  analytics: {
    send: (params: {
      event: string
      data: Record<string, string | number>
      scope?: 'event' | 'page' | 'session' | 'sku'
    }) => Promise<void>
  }
}
`}</code></pre>
    <p>{`Outras métricas e dimensões (tais como SKU, customerId, sistema operacional, etc.) são enviadas automaticamente e não precisam ser especificadas.`}</p>
    <p>{`Se analyticsParams.dataLayerIntegration for true, os seguintes eventos são enviados por padrão ao dataLayer:`}</p>
    <ul>
      <li parentName="ul">{`product_page_view: Enviado em uma vez por página quando sku.isActive é chamado, para marcar visualizações de página de produto`}</li>
      <li parentName="ul">{`impression: Enviado uma até uma vez por visualização de página em que RA / 3D é mostrado`}</li>
      <li parentName="ul">{`click: Enviado em todos os cliques em RA / visualização 3D`}</li>
    </ul>
    <p>{`A documentação para enviar os dados do dataLayer para o Google Analytics está  `}<a parentName="p" {...{
        "href": "https://github.com/r2u-io/documentation/blob/master/gtm_setup/Analytics_Setup_pt-br.md"
      }}>{`aqui`}</a></p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
